import React from "react";
import Container from "react-bootstrap/Container";
import styled from "styled-components";
import FormControl from "@mui/material/FormControl";
import InputLabel from "@mui/material/InputLabel";
import Input from "@mui/material/Input";
import InputAdornment from "@mui/material/InputAdornment";
import IconButton from "@mui/material/IconButton";
import SearchIcon from "@mui/icons-material/Search";
import Item from "./Item";
import leftbg from "../assets/images/left-bg.png";
import rightbg from "../assets/images/right-bg.png";
import Skewright from "./Skewright";
import Skewleft from "./Skewleft";


const Home = () => {

  return (
    <>
    <Homewrapper>
          <Container className="search_section common_margin">
            {/*search text field start*/}
            <div className="search_area">
              <FormControl sx={{ m: 1, width: "40ch" }} variant="standard">
                <InputLabel htmlFor="standard-adornment-password">
                  Search student By Name...
                </InputLabel>
                <Input
                  id="standard-adornment-password"
                  type="search"
                  endAdornment={
                    <InputAdornment position="end">
                      <IconButton aria-label="toggle password visibility">
                        <SearchIcon />
                      </IconButton>
                    </InputAdornment>
                  }
                />
              </FormControl>
            </div>
            {/*search text field end*/}

            <div className="item_container">
              <Item />
              <Item />
              <Item />
              <Item />
              <Item />
              <Item />
              <Item />
            </div>
          </Container>
    </Homewrapper>

    <Streamwrapper>
      <Skewleft/>
      <Container className="stream_section common_margin">
        <p>hello</p>
      </Container>
    </Streamwrapper>
    </>
   

  );
};

export default Home;
